import React from 'react'
import '../navbar/navbar.css'
const MakeAComment = () => {
  return (
    <div>
        <div className='navbar'>
          <li>HOME</li>
            <li>ABOUT</li>
            <li>DEVELOPER</li>
        </div>
    </div>
  );
}

export default MakeAComment;
